Genesis: A History

Arts Documentary hosted by Tony Cosgrove, published by BSkyB in 1990 - English narration


Information
------------------------------

Genesis: A History
Featuring rare, live, and television footage, never seen before on video, tracing a history of perhaps the most dominant adult rock group of the 70's and 80's.
This video shows their evolution as band from their formation, all through their Gabriel years, after Gabriel but before Hackett left and their lives after &quot;An Then There Were Three&quot; with Collins at the helm. It doesn't include (not that I miss it) their latest work before dissolving as a band, you get exposed to high-quality footage of their early work, which as a fan you probably got a chance to see in some deteriorated shape at some point, so you know there's hope for you to some day see the footage of the band performing in the early seventies and being able to distinguish the audio and the video.
There are interviews with Collins, Banks, Rutherford, Gabriel, Phillips and Hackett

